import PricingFive from '../../../elements/price/element/price5';
import { Container, Row, Col } from 'reactstrap'

var settings = {
    dots: true,
    arrows: false,
    infinite: true,
    speed: 500,
    arrows: false,
    slidesToShow: 3,
    autoplay: true,
    centerMode: true,
    centerPadding: '0',
    slidesToScroll: 1,
    responsive: [
        {
            breakpoint: 992,
            settings: { slidesToShow: 1 }
        }
    ]
};

const Pricing = () => (
    <section className="gym pricing set-relative" id="plan">
